import snappy

import struct

# python-snappy compression output:
# uncompressed_len: varint+ + lz77symbol*: byte*
# note: each lz77symbols starts with a tag byte


def pack_varint(val):
    total = b""
    if val < 0:
        val = (1 << 32) + val
    while val >= 0x80:
        bits = val & 0x7F
        val >>= 7
        total += struct.pack("B", (0x80 | bits))
    bits = val & 0x7F
    total += struct.pack("B", bits)
    return total


def unpack_varint(buff):
    total = 0
    shift = 0
    val = 0x80
    while val & 0x80:
        val = struct.unpack("B", bbuff.read(1))[0]
        total |= (val & 0x7F) << shift
        shift += 7
    if total & (1 << 31):
        total = total - (1 << 32)
    return total


def hex_values(bytestream, fmt="{:02X}"):
    return " ".join(fmt.format(a) for a in bytestream)


def hex_char_to_int(c):
    c = c.lower()
    if c in "abcdef":
        return ord(c) - ord("a") + 10
    else:
        return int(c)


def hex_char_pair_to_int(hi4, lo4):
    result = hex_char_to_int(lo4)
    result |= hex_char_to_int(hi4) << 4
    return result


def hipcomp_input_to_bytes(text):
    result = bytearray([])
    for i in range(0, len(text), 2):
        result += hex_char_pair_to_int(text[i], text[i + 1]).to_bytes(1, "little")
    return bytes(result)


def example_1():
    input_bytes = "BEGIN:"
    input_bytes = input_bytes.encode("ascii")
    compressed = snappy.compress(input_bytes)

    print(f"{len(input_bytes)=}")
    print(f"{len(compressed)=}")
    print(f"{hex_values(pack_varint(len(input_bytes)))=}")
    print(f"{hex_values(b'BEGIN')=}")
    print(f"{hex_values(compressed)=}")


def example_2():
    input_bytes = "BEGIN: snappy +" * 1000 + " " + "by " * 1000 + " google"
    input_bytes = input_bytes.encode("ascii")
    compressed = snappy.compress(input_bytes)

    print(f"{len(input_bytes)=}")
    print(f"{len(compressed)=}")
    print(f"{hex_values(pack_varint(len(input_bytes)))=}")
    print(f"{hex_values(b'BEGIN')=}")
    print(f"{hex_values(compressed)=}")


